nnection within the accounts list and can be anything you like.'=>'Digunakan untuk mengidentifikasi koneksi ini dalam daftar akun dan bisa diisi sesuai keinginan.','Account Name'=>'Nama Akun','Account name for a third party service such as MailChimp.Error: Missing account name.'=>'Galat: Nama akun belum dimasukkan.','Connection data such as an API key.Error: Missing service data.'=>'Galat: Data layanan tidak ditemukan.','Third party service such as MailChimp.Error: Missing service type.'=>'Galat: Tipe layanan tidak ditemukan.','There was an error subscribing. MailPoet is not installed.'=>'Ada galat saat mendaftar. MailPoet tidak terinstal.','There was an error retrieveing your lists.'=>'Ada galat saat menerima daftar anda.','There was an error subscribing to MailChimp. %s'=>'Ada galat saat mendaftar ke MailChimp. %s','There was an error subscribing to MailChimp. The account is no longer connected.'=>'Ada galat saat mendaftar ke MailChimp. Akin tidak lagi terkoneksi.','MailChimp list group.Groups'=>'Grup','No Group'=>'Tanpa Grup','There was an error subscribing to Mad Mimi. The account is no longer connected.'=>'Ada galat saat mendaftar ke Mad Mimi. Akun tidak lagi terkoneksi.','The email address associated with your Mad Mimi account.'=>'Alamat surel terasosiasi dengan akun Mad Mimi.','There was an error subscribing to Infusionsoft. %s'=>'Ada galat saat mendaftar ke Infusionsoft. %s','Center Top'=>'Tengah Atas ','Your API key can be found in your MailChimp account under Account > Extras > API Keys.'=>'Kunci API dapat ditemukan pada akun MailChimp Anda, dibawah Account > Extras > API Keys','Your API key can be found in your Mad Mimi account under Account > Settings &amp; Billing > API.'=>'Kunci API dapat ditemukan di akun Mad Mimi Anda, dibawah Account > Settings &amp; Billing > API.','What would you like to do?'=>'Apa yang ingin Anda lakukan?','Welcome! It looks like this might be your first time using the builder. Would you like to take a tour?'=>'Selamat datang! Nampaknya ini adalah pertama kali Anda menggunakan builder. Apakah Anda ingin mengikuti wisata penjelasan?','Use the Templates button to pick a new template or append one to your layout. Appending will insert a new template at the end of your existing page content.'=>'Gunakan tombol Pola untuk memilih pola baru atau menambahkan ke tata letak Anda. Penambahan akan memasukkan pola baru pada akhir halaman konten Anda yang sekarang.','Use the Add Content button to open the content panel and add new row layouts, modules or widgets.'=>'Gunakan tombol Tambah Konten untuk membuka panel konten dan menambah baris tata letak baru, modul, atau widget.','Warning! Changing the template will replace your existing layout. Do you really want to do this?'=>'Peringatan! Merubah pola akan mengganti tata letak anda saat ini. Apakah Anda benar-benar ingin melakukan ini?','Use the action buttons to perform actions such as moving, editing, duplicating or deleting rows, columns and modules.'=>'Gunakan tombol aksi untuk melakukan aksi seperti memindahkan, menyunting, menduplikasi, atau menghapus baris, kolom dan modul.','Unable to connect to Mad Mimi. Please check your credentials.'=>'Tidak dapat terkoneksi ke Mad Mimi. Mohon periksa kredensial Anda.','There was a problem retrieving your lists. Please check your API credentials.'=>'Ada masalah menerima daftar Anda. Mohon periksa kredensial API Anda.','The settings you are currently editing will not be saved if you navigate away from this page.'=>'Pengaturan yang sedanga Anda sunting tidak akan di simpan bila Anda keluar dari halaman ini.','The builder does not delete the post meta <code>_fl_builder_data</code>, <code>_fl_builder_draft</code> and <code>_fl_builder_enabled</code> in case you want to reinstall it later. If you do, the builder will rebuild all of its data using those meta values.'=>'Builder tidak menghapus meta artikel: <code>_fl_builder_data</code>, <code>_fl_builder_draft</code> dan <code>_fl_builder_enabled</code> mengantisipasi jika nantinya Anda akan menginstal kembali. Jika ya, builder akan membangun kembali seluruh data menggunakan nilai meta tersebut.','The browser width at which the layout will adjust for small devices such as phones.'=>'Lebar browser yang akan disesuaikan oleh tata letak untuk gawai kecil seperti ponsel.','The browser width at which the layout will adjust for medium devices such as tablets.'=>'Lebar browser dimana tata letak akan disesuaikan untuk gawai sedang seperti tablet.','Text Editor'=>'Penyunting Teks','Take a Tour'=>'Lakukan Wisata Belajar','%s stands for custom branded \\"Page Builder\\" name.Switching to Text Editor mode will disable your %1$s layout until it is enabled again. Any edits made while in Text Editor mode will not be made on your %1$s layout. Do you want to continue?'=>'Perubahan ke mode Penyunting Teks akan menonaktifkan tata-letak %1$s Anda sampai diaktifkan kembali. Penyuntingan yang dilakukan saat dalam mode Penyunting Teks tidak akan tersimpan pada tata letak %1$s Anda. Apakah Anda ingin melanjutkan?','Small Devices Only'=>'Khusus Gawai Kecil','Small Device Breakpoint'=>'Titik-ubah Gawai Kecil','Select the post types you would like the builder to work with.'=>'Pilih tipe artikel yang ingin Anda gunakan dengan builder.','Replace Existing Layout'=>'Gantikan Tata Letak yang Sekarang','Responsive Layout'=>'Tata Letak Responsif','Order By'=>'Urut Berdasarkan','Pull images from the WordPress media library or a gallery on your SmugMug site by inserting the RSS feed URL from SmugMug. The RSS feed URL can be accessed by using the get a link function in your SmugMug gallery.'=>'Ambil gambar dari pustaka media WordPress atau galeri situs SmugMug anda dengan memasukkan RSS URL umpan dari SmugMug. RSS URL umpan dapat diakses menggunakan fungsi ambil tautan pada galeri SmigMug Anda.','Please type "uninstall" in the box below to confirm that you really want to uninstall the page builder and all of its data.'=>'Ketik "uninstall" pada kotak dibawah untuk mengonfirmasi bahwa Anda benar-benar ingin menghapus pemasangan builder halaman beserta seluruh data-nya.','Please select either a background layout or content layout before submitting.'=>'Harap pilih salah satu, tata letak latar belakang atau tata letak konten sebelum mengirim.','Padding'=>'Pengisi (Padding)','Once you\'re finished, click the Done button to publish your changes, save a draft or revert back to the last published state.'=>'Setelah Anda selesai, klik tombol Selesai untuk mempublikasikan perubahan, simpan konsep, atau kembalikan ke kondisi publikasi terakhir.','Medium Device Breakpoint'=>'Titik-ubah Gawai Sedang','Medium &amp; Small Devices Only'=>'Khusus Gawai Sedang &amp; Kecil','Medium'=>'Sedang','Now that you know the basics, you\'re ready to start building! If at any time you need help, click the help icon in the upper right corner to access the help menu. Happy building!'=>'Sekarang setelah memahami dasarnya, Anda siap untuk mulai membangun! Jika membutuhkan bantuan, klik ikon bantuan pada ujung kanan atas untuk mengakses menu bantuan. Selamat membangun!','NOTE: Not all custom post types may be supported.'=>'CATATAN: Tidak semua tipe artikel ragam bisa didukung.','Move your mouse over rows, columns or modules to edit and interact with them.'=>'Gerakkan tetikus Anda keatas baris, kolom, atau modul untuk menyunting dan berinteraksi.','Fallback Photo'=>'Foto Alternatif','Animation style.Fade In'=>'Masuk Memudar','Fade'=>'Memudar','Edit Gallery'=>'Sunting Galeri','Edit Content'=>'Sunting Konten','%s stands for form field label.Edit %s'=>'Sungting %s','Duplicate page/post action label.Duplicate Layout'=>'Duplikasi Tata Letak','Drop a row layout or module to get started!'=>'Pilih tata letak baris atau modul untuk memulai!','Do you really want to discard these changes? All of your changes that are not published will be lost.'=>'Apakah Anda benar-benar ingin membatalkan perubahan yang dilakukan? Semua perubahan yang belum di publikasikan akan hilang.','Do you really want to delete this template?'=>'Apakah Anda benar-benar ingin menghapus pola ini?','Do you really want to delete this item?'=>'Apakah Anda benar-benar ingin menghapus item ini?','Descending'=>'Menurun','Delay'=>'Tunda','Default Row Width'=>'Nilai-baku Lebar Baris','Default Row Content Width'=>'Nilai-baku Lebar Konten Baris ','Default Page Heading'=>'Tajuk Halaman Baku','Default'=>'Baku','Date Last Modified'=>'Tanggal Perubahan Terakhir','Custom'=>'Ragam','Ascending'=>'Menaik','Are you sure you want to remove this account? Other modules that are connected to it will be affected.'=>'Apakah Anda yakin akan menghapus akun ini? Semua modul yang terkoneksi akan terpengaruh.','Append New Layout'=>'Tambah Tata Letak Baru','Clicking the button below will uninstall the page builder plugin and delete all of the data associated with it. You can uninstall or deactivate the page builder from the plugins page instead if you do not wish to delete the data.'=>'Mengklik tombol dibawah akan menghapus instalasi plugin builder halaman dan menghapus seluruh data yang terkait. Anda dapat menghapus pemasangan atau melakukan deaktifasi builder halaman dari halaman plugin bila Anda tidak ingin menghapus seluruh data.','Check or uncheck modules below to enable or disable them.'=>'Centang atau jangan-centang modul dibawah untuk mengaktifkan atau menonaktifkan.','Beaver Builder caught the following JavaScript error. If Beaver Builder is not functioning as expected the cause is most likely this error. Please help us by disabling all plugins and testing Beaver Builder while reactivating each to determine if the issue is related to a third party plugin.'=>'Beaver Builder menemukan galat JavaScript berikut. Jika Beaver Builder tidak berfungsi sebagaimana diharapkan, penyebabnya kemungkinan adalah galat ini. Mohon membantu kami dengan cara mematikan semua plugin, lalu menguji Beaver Builder dengan cara mengaktifkan plugin satu-persatu guna mengetahui masalah ini terjadi terkait dengan plugin yang mana.','Background Video'=>'Video Latar Belakang','Background Slideshow'=>'Latar Belakang Tampilan-geser','Background Overlay'=>'Hamparan Latar Belakang','Background Color'=>'Warna Latar Belakang','Background'=>'Latar Belakang','Add new content by dragging and dropping modules or widgets into your row layouts or to create a new row layout.'=>'Tambah konten baru dengan menyeret dan menaruh modul atau elemen interaksi (widget) kedalam baris tata letak anda atau untuk membuat baris tata letak baru.','Add multi-column rows, adjust spacing, add backgrounds and more by dragging and dropping row layouts onto the page.'=>'Tambah baris berkolom ganda, sesuaikan spasi, tambah latar belakang, dan lainnya, dengan menyeret dan menaruh tata letak baris kedalam halaman.','Choosing no will hide the default theme heading for the "Page" post type. You will also be required to enter some basic CSS for this to work if you choose no.'=>'Memilih tidak akan menyembunyikan heading tema default untuk tipe artikel halaman. Anda akan diminta memasukkan CSS dasar agar ini dapat bekerja bila Anda memilih tidak.','A CSS and JavaScript file is dynamically generated and cached each time you create a new layout. Sometimes the cache needs to be refreshed when you migrate your site to another server or update to the latest version. If you are running into any issues, please try clearing the cache by clicking the button below.'=>'Berkas CSS dan JavaScript secara dinamis di buat dan disinggahkan (cached) setiap anda membuat tata-letak baru. Terkadang singgahan perlu disegarkan saat anda memigrasi situs ke server lain atau membaharui ke versi terakhir. Jika anda mengalami masalah, silahkan coba membersihkan singgahan dengan mengklik tombol dibawah ini.','A class that will be applied to this module\'s HTML. Must start with a letter and only contain dashes, underscores, letters or numbers. Separate multiple classes with spaces.'=>'Kelas yang akan diaplikasikan pada HTML modul ini. Harus dimulai dengan huruf dan hanya berisi garis, garis bawah, huruf atau angka. Pisahkan kelas dengan spasi.','A class that will be applied to this column\'s HTML. Must start with a letter and only contain dashes, underscores, letters or numbers. Separate multiple classes with spaces.'=>'Kelas yang akan diaplikasikan ke HTML kolom ini. Harus dimulai dengan huruf dan hanya berisi garis, garis bawah, huruf atau angka. Pisahkan kelas dengan spasi.','"{message}" on line {line} of {file}.'=>'"{message}" pada baris {line} dari {file}.','General settings form field label. Intended meaning: "Enable auto spacing for responsive layouts?"Enable Auto Spacing'=>'Aktifkan Spasi Otomatis','General settings form field label. Intended meaning: "Responsive layout enabled?"Enabled'=>'Aktifkan','Enter a CSS selector for the default page heading to hide it.'=>'Masukkan pemilih CSS pada tajuk halaman baku untuk menyembunyikannya.','Enter a post title to search.'=>'Masukkan judul artikel untuk dicari.','Enter a comma separated list of the post types you would like the builder to work with.'=>'Masukkan daftar terpisah koma dari tipe artikel yang anda ingin olah menggunakan builder.','Enabled Modules'=>'Aktifkan Modul','Account name for a third party service such as MailChimp.Error: An account with that name already exists.'=>'Galat: Akun dengan nama tersebut sudah ada.','Name'=>'Nama','There was an error subscribing to Infusionsoft. The account is no longer connected.'=>'Ada galat saat mendaftar ke Infusionsoft. Akun tidak lagi terkoneksi.','Error: You must provide an app ID.'=>'Galat: Anda harus memasukkan ID app.','There was an error connecting to Infusionsoft. %s'=>'Ada galat saat koneksi ke Infusionsoft. %s','There was an error subscribing to iContact. %s'=>'Ada galat saat mendaftar ke iContact. %s','There was an error subscribing to iContact. The account is no longer connected.'=>'Ada galat saat mendaftar ke iContact. Akun tidak lagi terkoneksi.','You must <a%1$s>create an app</a> in